export const PhillipsList = [
  {
    linkItem: "catalog/uzi-apparats/phillips/affinity50",
    imgItem: <img class="uzi__item-img" src={affinity50} alt="senatmed сенатмед" />,
    from: 'Phillips Нидерланды',
    model: 'Affinity 50',
    subtitle: 'УЗ аппарат экспертного класса',
  }
]
